  input: '"TEXT","F3XA","C00165688","ASDC Dollars for Democrats, ASDC Partnership
    Program, and the State Democratic Party Victory Fund are joint fundraising programs
    in which the North Carolina Democratic Party participates.   Transfers are made
    to the NCDP on an as-needed basis.  Please note that state party committees have
    been reporting Memo Entries on Schedule A for contributions received by the joint
    fundraising program during the reporting period in which the contribution was
    received irrespective of whether transfers have been made.  Memo Entries on Schedule
    A from these programs reflect the gross amounts raised while the transfers to
    the NCDP reflect the net amount distributed to date.  Accordingly, there will
    always be a difference between the transfer and the Memo Schedule A totals.  By
    prior agreement between the NCDPs counsel and the FEC, Memo Schedule As for these
    programs are reported on a quarterly basis    Please see notation above.  The
    transfers reported on this report for the DNC/State Party Victory Fund and the
    ASDC Partnership Program reflect proceeds from the joint fundraising program that
    have been reported (as Memo Schedules) on prior reports.    The NCDP has used
    its best efforts as defined by the FEC to disclose the full identity of all individuals
    who contribute in excess of $200 in a calendar year.  In addition to requesting
    the information on the original solicitation, every 30 days the NCDP sends to
    all donors whose information is not complete a letter requesting the required
    information and includes a self-addressed stamped reply postcard.    All Payroll,
    Payroll Taxes, AFLCA Payroll,  Health Insurance, Payroll Pd to Seligman, and Supplemental
    Insurance disclosed on Schedule H4 are for employees who did NOT spend more than
    25% of their compensated time in a given month on Federal Election Activity (FEA)
    or activities in connection with a Federal election.    No disbursement disclosed
    on Schedule B Supporting Line 21 or Schedule H4 of this report referred to a clearly
    identified federal candidate or was made on behalf of a clearly identified federal
    candidate.    Some memo entry records for disbursements disclosed on Schedule
    B do not appear because the payments to the original vendor did not exceed the
    $200 aggregate threshold required for itemization.    The Committee diligently
    and timely filed 24-hour notices relating to Schedule F payments for disbursements
    made through Election Day.  Payments made after Election Day reflect expenditures
    that were incurred on Election Day itself for which we did not know the final
    amount owed until after Election Day or were for expenses incurred after Election
    Day which it is our understanding are not applicable to the Millionaires Amendment
    reporting requirements.  "'
